def countCos(v1, v2, msg):   
    dd_city = cosine_similarity(v2, v1)
    #print (msg)     
    for d in dd_city: 
        #print(round(d[0],3)) 
        print("{}\t {}".format(msg,  round(d[0],3)))
        
